Being part of this movie makes me so damn stoked! Not just because i had a blast joining the homies on an epic trip in austria, but because it sums up an amazing journey of developing the Revolt 121. We had our first skitests in december 2017, kept on working on it with the team all winter till the final test round in Bariloche a year ago. We were all so damn stoked about this ski!
It was the hardest time waiting until ISPO 2019, till we could finally really use and show it. Then the shooting for „ONE TWO ONE“ started where we could do whatever we wanted. Basically go out, shred hard and have a blast with the homies! Everything a freeskier really wants. Now the teaser is out and i‘m so hyped! Crazy to think that this whole movie has been shot on one ski...
I haven‘t seen anything of the movie yet and I can‘t wait to finally check it out on the big screen in Annecy at the @highfivefestival beginning of next month! Huge shout out to @voelklskis for making it all happen, the team for the stoke and effort and @thelegsofsteel for showcasing what we do in the best way! In case you want to host a premiere, check out the link in my bio for all the info. It‘s for free and you might win a pair of skis too!
